import React from 'react';
import './TableProducts.scss'

const TableProducts = ({products})=> {
    const history = useHistory();

    const handleVerMovimientos = () => {
        // Redirige a la página de movimientos del producto específico
        history.push(`/Movement`);
    };
    return(
            <div className="products-table">
            <table>
                <thead>
                <tr>
                    <th>Número</th>
                    <th>Nombre</th>
                    <th>Marca</th>
                    <th>Detalle</th>
                    <th>Movimientos</th>
                </tr>
                </thead>
                {products.map((product, index) => (
                    <tr key={product.id}>
                    <td>{product.id}</td>
                    <td>{product.name}</td>
                    <td>{product.brand}</td>
                    <td><button className="details-btn">Ver detalle</button></td>
                    <td><button className="movements-btn" onClick={handleVerMovimientos}>Ver movimientos</button></td>
                    </tr>
                ))}
            </table>
            </div>
        )
}
export default TableProducts;
